import React from 'react'

const Blog = ({ blog }) => {
  const blogStyle = {
    paddingTop: 10,
    paddingLeft: 2,
    border: 'solid',
    borderWidth: 1,
    marginBottom: 5
  }

  return (
    <div style={blogStyle}>
      <div onClick={() => console.log('clicked')}>
        {blog.title} {blog.author}
        <br />
        <a href={blog.url}>{blog.url}</a>
        <br />
        console.log(blog.likes)
        likes: {blog.likes}
        <button >like</button>
        <p>Added by {blog.user.name}</p>

      </div>

    </div>
  )
} 

export default Blog
